  [],\n\t\"revision_timestamp\": \"2016-07-27T22:58:08.513992\",\n\t\"name\": \"the-status-of-the-red-cockaded-woodpecker-at-blackwater-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Red-cockaded Woodpecker is a rare southern
  bird with exacting habitat requirements. The species is unable or slow to adapt
  to man's activities and has been placed on the Department of the Interior's list
  of endangered species. As of 1972, less than 3000 of these birds remained in the
  southeastern United States piney forests, the birds only usable habitat. In the
  past few years, the birds have periodically been seen at the nearby Blackwater National
  Wildlife Refuge.  One objective of this study was to describe and analyze trees
  on the Refuge known to show typical sign of Red-cockaded cavity workings.  A second
  objective was to gather quantitative forestry data on three pine tracts at the Blackwater
  Refuge. The compiled data were compared with corresponding habitat values from known
  Red-cockaded colonies in the South. The basic goal then, was to establish Blackwater
  Refuge's ability to support an active colony of this rare bird.\",\n\t\"license_title\":
